import './App.css';
import {
  createBrowserRouter,
RouterProvider
} from "react-router-dom"
import Product from './Product/Product';
import Home from './Home/Home';
import Products from './Products/Products';
const router=createBrowserRouter([
  {
    path:"/",
    element:<Home/>
  },
  {
    path:"/product/:id",
    element:<Product/>
  },
  {
    path:"/products/:id",
    element:<Products/>
  }


])
function App() {

  return (
    <div >
  <RouterProvider router={router}/>
    </div>
  );
}

export default App;
